import React from 'react';

const Courses = () => {
  return (
    <div className="container-fluid">
      <div className="row">
        <div className="col-12">
          <div className="card">
            <div className="card-header">
              <h4 className="mb-0">Courses Management</h4>
            </div>
            <div className="card-body">
              <p>课程管理页面内容将在这里显示...</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Courses;
